window.bookSummaryJSON = "<p><b>She's running for her life, and he's her last hope, but also her biggest temptation.</b></p> <p>An innocent woman, a deadly cartel, her brooding Guardian Protector, and a love that could be her salvation or downfall. Cara, an innocent woman, finds herself in witness protection after agreeing to testify against a deadly cartel. But her enemies close in when her location is compromised. With death lurking at every turn, her only chance of survival rests with Chase, her brooding Guardian Protector, a former Army Special Forces Scout Sniper with lethal skills.</p> <p>In a heart-pounding game of cat and mouse, Cara and Chase must evade the cartel while their attraction for each other grows stronger. But with every step they take, the threat of capture looms. Will they outsmart their pursuers and find a way to be together, or will their love become their downfall?</p> <p>Experience an electrifying tale of danger, desire, and romantic suspense.</p> <p>Download your copy of CARA'S PROTECTOR today and join Cara and Chase on their thrilling journey</p>"; 
